import React, { useState } from "react";
import { Route, Routes} from 'react-router-dom';
import HeaderNav from "./components/headerNav/HeaderNav";
import './App.css'
import Main from "./components/pages/main/Main";
import About from "./components/pages/about/About";
import Footer from "./components/footer/Footer";
import Blog from "./components/pages/blog/Blog";
import Item from "./components/pages/blog/Item";
import Kategory from "./components/pages/kategory/Kategory";
import Busket from "./components/busket/Busket";


function App() {
  const [show,setShow] = useState(true)
  const [cart,setCart] = useState([])

  const handle = (item)=>{
      cart.push(item);
      console.log(cart)
  }
  return (
    <div className="App">
      <HeaderNav setShow={setShow} />
      {
show?<Routes>

<Route path="/"  element={<Main />}/>
<Route path="/about"  element={<About />}/>
<Route path="/blog"  element={<Blog handle={handle} />}/>
<Route path="/blog/item"  element={<Item />}/>
<Route path="/kategory"  element={<Kategory />}/>
</Routes>:<Busket cart={cart} setCart={setCart} handle={handle}/>
      }

       <Footer />

    </div>
  );
}

export default App;
